// src/components/HomePage.js
import React from 'react';
import { Container, Row, Col, Button } from 'react-bootstrap';
import { Link } from 'react-router-dom';

const LandingPage = () => {
    return (
        <>
            <Container fluid className='landing-page background'>
                <h1 className='Title'>Find Your Team,</h1>
                <h1 className='Title'>Join the Community.</h1>
                <Row className='linkbutton row'>
                        <Col md={6}>
                            <Link to="/signup">
                                <Button size="sm" className="linkbutton filled mt-3">Get started</Button>
                            </Link>
                        </Col>
                        <Col md={6}>
                            <a href="/find-your-team" className="d-block mt-3">Find your team</a>
                        </Col>
                    </Row>
            </Container>
        </>
    );
};

export default LandingPage;
